import React from 'react';
import { Card_item } from '../experience/experience.component';
const classlist = require('json-loader!./data/classes.json');

export const CardList = props => (
    <div>
        {props.classlist.map(classwork => (
        <Card_item
        key = {classwork.id} 
        classwork = {classwork}/>
        ))}
    </div>
);
